import s from './SideBar.module.css';
import logo from '../../assets/img/Frame 40.png';

const SideBar = () => {
	return (
		<div className={s.side_bar}>
			<a href="#" className={s.side_bar__logo}>
				<img src={logo} alt="logo" />
			</a>
		</div>
	);
};

export default SideBar;
